import { extendTheme } from "@chakra-ui/react";

const theme = extendTheme({
  fonts: {
    heading: "rubrik-new, sans-serif",
    body: "rubrik-new, sans-serif",
  },
  fontWeights: {
    light: 300,
    medium: 500,
    mediu,
  },
});

export default theme;
